import React from 'react';

const SearchResult = (props) => {
    const img = `https://source.unsplash.com/400x300/?${props.name}`;

    return (
        <>
           <div>
               {
                   props.name ? <img src={img} alt="Bapu" /> : null
               }
           </div>
        </>
    );
}

export default SearchResult;
